        return new Source("{% extends 'base.html.twig' %}

{% block title %}Log in!{% endblock %}

{% block body %}

<div class=\"container\">
    <div class=\"container\">
<form method=\"post\">

    <br></br>

    {% if error %}

    <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}
    </div>
    {% endif %}

            <h1 class=\"h3 mb-3 font-weight-normal\">Please sign in</h1>
            <label for=\"inputUsername\">Username</label>
            <input 
                type=\"text\" 
                value=\"{{ last_username }}\" 
                name=\"username\" id=\"inputUsername\" 
                class=\"form-control\" 
                required autofocus
                >
            <label for=\"inputPassword\">Password</label>
            <input 
                type=\"password\" 
                name=\"password\" 
                id=\"inputPassword\" 
                class=\"form-control\" 
                required autofocus
                >

            <input 
                type=\"hidden\" 
                name=\"_csrf_token\"
                value=\"{{ csrf_token('authenticate') }}\"
                >

            <button class='#ffa726 btn orange lighten-1' type=\"submit\">
                Sign in
            </button>

        </form>

    </div>
</div>
<br></br>
<br></br>
